INSERT INTO `contents` VALUES(1, 1, 1, 1, 'Cobblestone Pub', '2013-08-27 23:16:03', '2013-08-27 23:43:16', 'Home of the finest traditional music, best pints of Guinness any man can find and the most laid-back and charming bar staff that you will come across. A combination of them all makes this pub one of the finest pubs that you will come across anywhere in Dublin.\r\n \r\nThe environment is rustic and homely with artifacts on the wall from many a persons travel on the world. The walls have many stories to tell. We are sure that you will find many a personality around the Cobblestone that can fill you in on a story or two. Wheather they are true or not is another story.\r\n \r\nYou are guarenteed to find a traditional session rocking up the front bar every evening, hosted by many a familiar face in the Irish Music scene. Saturday afternoons also play host to a stomping bluegrass session that drags every passer-by in with its infectious tunes.\r\n \r\nOur Back Room Venue gives an intimate enviroment for many a memorable concert. Genres range from Folk, ''=Roots and Traditional to Spoken Word and the odd interesting private function. You can find the gig listings at the Back Room link.\r\n\r\nsource: http://www.cobblestonepub.ie/', 0, 0, 'smi', -6.277831, 53.349824, 'history', , 'cobblestone.jpg', 'image/jpeg', NULL, NULL, 1, 1, 1);
INSERT INTO `contents` VALUES(2, 2, 1, 1, 'Third Space', '2013-08-27 23:16:22', '2013-08-28 01:05:22', 'Third Space is a place for local people to gather & eat easily, inexpensively & regularly, with space for creative, cultural and community activities.', 0, 0, 'smi', -6.278761, 53.347772, 'activity', , 'Third-Space-Smithfiled.jpg', 'image/jpeg', NULL, NULL, 1, 1, 1);
INSERT INTO `contents` VALUES(3, 2, 1, 1, 'Dicebar', '2013-08-27 23:17:20', '2013-08-28 01:05:25', 'Dice Bar is located on the corner of Benburb Street and  Queen Street, which is off Smithfield Square. \r\n\r\nWe''ve been watching over this corner since 3rd of May 2001, the night before the Buena Vista Social Club gig in Smithfield Square. \r\n\r\nAlthough there has been a bar here since 1770, when Dublin was the second biggest city in the empire. On Bow Street we had John Jameson Whiskey, across the river on Victoria Quay, Arthur Guinness was brewing stout.', 0, 0, 'smi', -6.280231, 53.347644, 'activity', , 'Dicebar Dublin.jpg', 'image/jpeg', NULL, NULL, 1, 1, 1);
INSERT INTO `contents` VALUES(4, 3, 1, 1, 'The Old Jameson Distillery Dublin', '2013-08-27 23:17:22', '2013-08-28 01:05:28', 'The Old Jameson Distillery is located on the original site of John Jameson''s distillery in Bow Street in Dublin.  This distillery, founded in 1780,  was Ireland''s most famous distillery for nearly 200 years, until its closure in 1971, when distilling of Jameson Irish Whiskey was transferred to the Midleton Distillery.  For many years the Bow Street Distillery lay abandoned, but today, once again, it is a hub of activity, welcoming visitors from all over the world.\r\n \r\nThis award wining visitor centre is one of Dublin''s and Ireland''s favourite attractions.  Located on the north side of the city, it is an easy walk from the city centre along the river Liffey, a short bus ride with Dublin''s Hop on Hop off bus tours, or only 3 minutes'' walk from the Smithfield Luas tram stop.  It is open throughout the year, with guided tours at regular intervals throughout the day.', 0, 0, 'smi', -6.277131, 53.348194, 'history', , 'The Old Jameson Distillery Dublin.jpg', 'image/jpeg', NULL, NULL, 1, 1, 1);
INSERT INTO `contents` VALUES(5, 4, 1, 1, 'Lighthouse Cinema', '2013-08-27 23:18:19', '2013-08-28 01:05:29', 'Light House Cinema is a specialist, art house cinema committed to programming the best Irish and international films. Our eclectic schedule includes feature films, shorts, classics, foreign language and animated films, feature length documentaries, inventive special events and festivals. In addition to our core specialist programming, we show films that might be considered more commercial art house and films that crossover into mainstream cinema when we believe that the film or its talent (writer, director, cast) are of particular interest to our audience. The films we select serve to challenge our audience and encourage engagement with current aesthetic, political, social and cultural issues and trends.\r\n', 0, 0, 'smi', -6.279041, 53.348668, 'activity', , 'Lighthouse cinema Dublin.jpeg', 'image/jpeg', NULL, NULL, 1, 1, 1);
