INSERT INTO `contents` VALUES(22, 6, 1, 1, 'Smithfield Horse Fair', '2013-08-28 00:50:59', '2013-08-28 01:05:35', 'Smithfield Market was laid out in the mid 17th century as a marketplace. Until its renovation in the early 21st Century, the square was lined with inner city "farm yards" housing livestock. In 1964 Richard Burton and Elizabeth Taylor spent time here, as Burton worked on the film set in Smithfield for the film adaptation of John le Carre''s novel The Spy Who Came in from the Cold. Smithfield featured as Checkpoint Charlie in the movie.\r\n\r\nSmithfield was rejuvenated under the HARP (Historic Area Rejuvenation Plan). An architectural competition was held and won by McGarry NiEanaigh Architects in 1997. The restoration involved lifting more than 400,000 one hundred and twenty-year-old cobblestones, cleaning them by hand and re-laying them.', 0, 0, 'smi', -6.278225, 53.348591, 'history', , 'Horse Fair.jpg', 'image/jpeg', NULL, NULL, 1, 1, 1);
